import React, { useState,use } from 'react'
import { useParams } from 'react-router-dom'

const UpdatePage = () => {
  const [form,setForm]=useState('')

  const {bid}=useParams()
  const callAPI=async()=>{
    const res=await axios.get(`/bbs/update/${bid}`)
   setForm(res.data)
  }

  useEffect(()=>{
    callAPI()
  },[])

  return (
    <div>
        <h1 className='text-center my-5'>수정</h1>
    </div>
  )
}

export default UpdatePage
